import React from 'react';
import { View, Text, Image, ScrollView } from 'react-native';

const Profile = () => {
  return (
    <ScrollView>
      {/* Left Side - Previous Game List */}
      <View>
        <Text style={{ fontSize: 20, fontWeight: 'bold', marginTop: 10 }}>
          Previous Game List
        </Text>
        {/* Add previous game list content here */}
      </View>

      {/* Right Side - Upcoming Game List */}
      <View>
        <Text style={{ fontSize: 20, fontWeight: 'bold', marginTop: 10 }}>
          Upcoming Game List
        </Text>
        {/* Add upcoming game list content here */}
      </View>

      {/* Middle Section */}
      <View style={{ alignItems: 'center', marginTop: 10 }}>
        {/* Welcome Message */}
        <Text style={{ fontSize: 24, fontWeight: 'bold' }}>
          Welcome, User Name
        </Text>

        {/* User Image */}
        <Image
          source={{ uri: 'https://example.com/fake-pic.jpg' }}
          style={{ width: 200, height: 200, marginTop: 10 }}
        />

        {/* Assigned Groups */}
        <View style={{ marginTop: 10 }}>
          <Text style={{ fontSize: 20, fontWeight: 'bold' }}>Assigned Groups</Text>
          {/* Add options for assigned groups */}
          <Text>Group One</Text>
          <Text>Group Two</Text>
          <Text>Group Three</Text>
          {/* ... Add more options as needed */}
        </View>
      </View>
    </ScrollView>
  );
};

export default Profile;
